  `kdupt` char(7) COLLATE utf8mb4_general_ci DEFAULT NULL,
  `lastupdate` char(10) COLLATE utf8mb4_general_ci DEFAULT NULL,
  `idupdater` char(10) COLLATE utf8mb4_general_ci DEFAULT NULL,
  PRIMARY KEY (`idpengguna`),
  UNIQUE KEY `username` (`username`),
  KEY `kdruangan` (`kdruangan`),
