/*Table structure for table `program` */

DROP TABLE IF EXISTS `program`;

CREATE TABLE `program` (
  `keyprogram` char(13) COLLATE utf8mb4_general_ci NOT NULL,
  `kdprogram` char(9) COLLATE utf8mb4_general_ci NOT NULL,
  `namaprogram` varchar(100) COLLATE utf8mb4_general_ci NOT NULL,
  `tahunanggaran` char(4) COLLATE utf8mb4_general_ci NOT NULL,
  PRIMARY KEY (`keyprogram`),
  UNIQUE KEY `kdprogram` (`kdprogram`,`tahunanggaran`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;

