/*Table structure for table `ruangan` */

DROP TABLE IF EXISTS `ruangan`;

CREATE TABLE `ruangan` (
  `kdruangan` char(10) COLLATE utf8mb4_general_ci NOT NULL,
  `namaruangan` varchar(100) COLLATE utf8mb4_general_ci NOT NULL,
  `alamat` varchar(255) COLLATE utf8mb4_general_ci NOT NULL,
  `notelp` char(16) COLLATE utf8mb4_general_ci NOT NULL,
  `kdupt` char(7) COLLATE utf8mb4_general_ci DEFAULT NULL,
  `statusaktif` char(1) COLLATE utf8mb4_general_ci NOT NULL,
  `lastupdate` datetime DEFAULT NULL,
  `idpengguna` char(10) COLLATE utf8mb4_general_ci DEFAULT NULL,
  PRIMARY KEY (`kdruangan`),
  KEY `kdupt` (`kdupt`),
  CONSTRAINT `ruangan_ibfk_1` FOREIGN KEY (`kdupt`) REFERENCES `upt` (`kdupt`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;

